import { useContext } from "react";
import AuthContext from "../AuthContext";
import { useNavigate } from "react-router-dom";
import Navbar from "../components/Navbar"; // Import Navbar component
import Banner from "../components/Banner"; // Import Banner component
import Categories from "../components/Categories"; // Import Categories component
import Promotions from "../components/Promotions"; // Import Promotions component
import NewArrivals from "../components/NewArrivals"; // Import NewArrivals component
import Advertisements from "../components/Advertisements"; // Import Advertisements component
import Products from "../components/Products"; // Import Products component
import Footer from "../components/Footer"; // Import Footer component
import "../styles/dashboard.css"; // Import Dashboard styles

const Dashboard = () => {
  const { logout } = useContext(AuthContext);
  const navigate = useNavigate();

  const handleLogout = () => {
    logout();
    navigate("/login");
  };

  return (
    <div className="dashboard-container">
      <Navbar />

      <div className="dashboard-content">
        <h1>Welcome to eMart Dashboard</h1>
        <p>Explore amazing deals, track orders, and manage your account.</p>

        {/* HomePage components */}
        <Banner />
        <Categories />
        <Promotions />
        <NewArrivals />
        <Advertisements />
        <Products />
        <Footer />

        <button className="logout-button" onClick={handleLogout}>
          Logout
        </button>
      </div>
    </div>
  );
};

export default Dashboard;
